          "title"    : "Day 1 with Pebble",
          "url"     : "/day-1-with-pebble.html",
          "date"     : "July 08, 2013",
          "content": "&lt;p&gt;&lt;img alt=&quot;image&quot; src=&quot;http://media.tumblr.com/6a2b8e8007854e770e651ee8e1161c55/tumblr_inline_mpnbaxeWDs1qz4rgp.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;I got my pebble today and I used it for couple of hours. I must say, I&amp;#8217;m not impressed. It was pretty easy to start and connect it with my iPhone 4S. I took couple of minutes to setup and to find a right watch face. The watchface that is shown in the picture is &lt;a href=&quot;http://www.mypebblefaces.com/?query=91+weather#&quot; target=&quot;_blank&quot;&gt;91 Weather Moonphase (iOS/ENU)&lt;/a&gt;. I will review this watchface at the end of this post. I will sort my findings to pros and cons.&lt;/p&gt;&lt;p&gt;&lt;!-- more --&gt;&lt;/p&gt;&lt;p&gt;Pros:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Music controls works flawless&lt;/li&gt;&lt;li&gt;Answering and ignoring calls is good, but has some lag though&lt;/li&gt;&lt;li&gt;SMS and iMessages arey displayed pretty decently and the navigation to read messages works fine.&lt;/li&gt;&lt;li&gt;Wide range of watchfaces available.&lt;/li&gt;&lt;li&gt;Did not find any issues with bluetooth connectivity.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Cons:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;No settings available to increase backlit time.&lt;/li&gt;&lt;li&gt;No controls to toggle volume.&lt;/li&gt;&lt;li&gt;Caller ID doesn&amp;#8217;t show the name of the caller (known issue)&lt;/li&gt;&lt;li&gt;Doesn&amp;#8217;t show Facebook, twitter and other notifications.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;It would be cool if there is another feature that shows the missed calls, voicemail and sms count. I found a watchface that shows weather data, but, It would be nice to have an option to see weather in pebble by default. &lt;/p&gt;&lt;p&gt;Android users will love this. Most of the cons that I posted works perfectly with Android devices.&lt;/p&gt;&lt;p&gt;I will try this watch for few more days and will decide if I want to keep it or return it.&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;http://www.mypebblefaces.com/?query=91+weather#&quot; target=&quot;_blank&quot;&gt;91 Weather Moonphase (iOS/ENU) Watch Face:&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;Pretty decent watch face that I found. Shows the current location weather. Limitations would be if I switch to another task and move back to this watch face, the weather detail disappears. The app that goes with this app needs to be opened in order to show that weather details.&lt;/span&gt;&lt;/p&gt;"
